function Hero(props) {
    return (<>
    <div className={props.cName}>
            <img alt="heroimg" src="https://images.unsplash.com/photo-1530076886461-ce58ea8abe24?q=80&w=1171&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"/>
    </div>

    <div className="hero-text">
        <h1>Your Journey Your Story</h1>
        <p>Choose your favourite destination</p>
        <a href="/">
            Travel Plan
        </a>
    </div>
    
    </>);
}

export default Hero;
